import {Route, BrowserRouter, Routes} from 'react-router-dom'
import LandingPage from './Pages/LandingPage'

const Router = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path='/' component={LandingPage}/>
            </Routes>
        </BrowserRouter>
    )
}

export default Router;
